{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/nguyenlehieuvan/case-study-1?scriptVersionId=220470550\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"58c9fee2","metadata":{"execution":{"iopub.execute_input":"2025-02-02T09:06:29.389123Z","iopub.status.busy":"2025-02-02T09:06:29.386543Z","iopub.status.idle":"2025-02-02T09:06:29.519994Z","shell.execute_reply":"2025-02-02T09:06:29.518011Z"},"papermill":{"duration":0.005281,"end_time":"2025-02-02T17:35:09.371675","exception":false,"start_time":"2025-02-02T17:35:09.366394","status":"completed"},"tags":[]},"source":["---\n","Case Study: How does a bike-share navigate speedy success?\n","---\n","\n","Author: Nguyen Le Hieu Van\n","\n","Date: \"02/02/2025\"\n","\n","This case study serves as the capstone of the [*<u>**Google Data Analytics Professional Certificate***](https://www.coursera.org/professional-certificates/google-data-analytics)"]},{"cell_type":"markdown","id":"9857c753","metadata":{"papermill":{"duration":0.004225,"end_time":"2025-02-02T17:35:09.380274","exception":false,"start_time":"2025-02-02T17:35:09.376049","status":"completed"},"tags":[]},"source":["---\n","Background Information\n","---\n","**Scenario**\n","\n","I am a junior data analyst working on the marketing analyst team at Cyclistic, a bike-share\n","company in Chicago. The director of marketing believes the company’s future success\n","depends on maximizing the number of annual memberships. Therefore, my team wants to\n","understand how casual riders and annual members use Cyclistic bikes diffrently. From these\n","insights, my team will design a new marketing strategy to convert casual riders into annual\n","members.\n","\n","**Characters and Teams**\n","\n","- Cyclistic: A bike-share program that features more than 5,800 bicycles and 600\n","docking stations. Cyclistic sets itself apart by also offring reclining bikes, hand\n","tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities\n","and riders who can’t use a standard two-wheeled bike. The majority of riders opt for\n","traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more\n","likely to ride for leisure, but about 30% use the bikes to commute to work each day.\n","- Lily Moreno: The director of marketing and my manager. Moreno is responsible for\n","the development of campaigns and initiatives to promote the bike-share program.\n","These may include email, social media, and other channels.\n","- Cyclistic marketing analytics team: A team of data analysts who are responsible for\n","collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy.\n","I joined this team six months ago and have been busy learning about Cyclistic’s\n","mission and business goals—as well as how me, as a junior data analyst, can help\n","Cyclistic achieve them.\n","- Cyclistic executive team: The notoriously detail-oriented executive team will decide\n","whether to approve the recommended marketing program.\n","\n","**About the company**\n","\n","In 2016, Cyclistic launched a successful bike-share offring. Since then, the program has grown\n","to a flet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across\n","Chicago. The bikes can be unlocked from one station and returned to any other station in the\n","system anytime.\n","\n","Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to\n","broad consumer segments. One approach that helped make these things possible was the\n","flxibility of its pricing plans: single-ride passes, full-day passes, and annual memberships.\n","Customers who purchase single-ride or full-day passes are referred to as casual riders.\n","Customers who purchase annual memberships are Cyclistic members.\n","\n","Cyclistic’s fiance analysts have concluded that annual members are much more profiable\n","than casual riders. Although the pricing flxibility helps Cyclistic attact more customers,\n","Moreno believes that maximizing the number of annual members will be key to future growth.\n","Rather than creating a marketing campaign that targets all-new customers, Moreno believes\n","there is a solid opportunity to convert casual riders into members. She notes that casual riders\n","are already aware of the Cyclistic program and have chosen Cyclistic for their mobility needs.\n","\n","Moreno has set a clear goal: Design marketing strategies aimed at converting casual riders into\n","annual members. In order to do that, however, the team needs to bettr understand how\n","annual members and casual riders diffr, why casual riders would buy a membership, and how\n","digital media could affct their marketing tactics. Moreno and her team are interested in\n","analyzing the Cyclistic historical bike trip data to identify trends."]},{"cell_type":"markdown","id":"13e2b8f7","metadata":{"papermill":{"duration":0.004125,"end_time":"2025-02-02T17:35:09.388583","exception":false,"start_time":"2025-02-02T17:35:09.384458","status":"completed"},"tags":[]},"source":["---\n","Ask\n","---\n","**Business task**: Analyze the differences in bike usage between casual riders and annual members. Base on these insights that me and my team collect, we will create a marketing strategy aimed at converting casual riders into annual members.\n","\n","**Key stakeholders**:\n","\n","- The director of marketing team Lily Moreno.\n","- The marketing analysis team.\n","- Cyclistic executive team.\n","  \n","**6 Data Analytics Phases**\n","\n","This project will be completed using these deliverables:\n","\n","- Ask: A clear statement of the business task.\n","- Prepare: A description of all data sources used.\n","- Process: Documentation of any cleaning or manipulation of data.\n","- Analyze: A summary of my analysis.\n","- Share: Supporting visualizations and key findings.\n","- Act: Top three recommendations based on my analysis."]},{"cell_type":"markdown","id":"38effd5d","metadata":{"papermill":{"duration":0.004172,"end_time":"2025-02-02T17:35:09.396828","exception":false,"start_time":"2025-02-02T17:35:09.392656","status":"completed"},"tags":[]},"source":["---\n","Prepare\n","---\n","**Key tasks**:\n","\n","- Download data and store it appropriately.\n","- Identify how it’s organized.\n","- Sort and fiter the data.\n","- Determine the credibility of the data.\n","\n","The data my team used for this analysis is Cyclistic's historical trip data, provided by Motivate International Inc. under a [public license](https://divvybikes.com/data-license-agreement). This dataset includes 12 months of bike-share trip records, with each row representing a single ride. The datasets are available for download [here](https://divvy-tripdata.s3.amazonaws.com/index.html)."]},{"cell_type":"code","execution_count":1,"id":"561da781","metadata":{"execution":{"iopub.execute_input":"2025-02-02T17:35:09.408959Z","iopub.status.busy":"2025-02-02T17:35:09.406978Z","iopub.status.idle":"2025-02-02T17:35:10.874217Z","shell.execute_reply":"2025-02-02T17:35:10.8725Z"},"papermill":{"duration":1.475484,"end_time":"2025-02-02T17:35:10.876388","exception":false,"start_time":"2025-02-02T17:35:09.400904","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.5\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.1\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.5.1     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.