ted directly from Cyclistic’s bike-share system.\n","- Comprehensive: The data includes all necessary fields to analyze rider behavior (e.g., ride duration, rider type, start/end locations).\n","- Current: The data is up-to-date, covering the most recent 12 months of trip data.\n","- Cited: The data is properly cited and made available under a public license.\n","2. **Governance**\n","- Licensing: The data is publicly available under a license provided by Motivate International Inc.\n","- Privacy: Personally identifiable information (PII) is not included in the dataset, ensuring compliance with data privacy regulations.\n","- Security: The data is stored securely on your local machine or cloud storage, with access restricted to authorized team members.\n","- Accessibility: The data is in CSV format, which is widely accessible and compatible with most data analysis tools (e.g., Excel, Google Sheets, R, Python).\n","3. **Data integrity**\n","- Checking for missing or null values.\n","- Ensuring consistent formatting across all columns (e.g., timestamps, ride IDs).\n","- Confirming that the data aligns with Cyclistic’s operational records (e.g., number of bikes, stations, and trips).\n","4. **Potential problems**\n","- Missing or incomplete data (e.g., null values in station names or ride durations).\n","- Outliers in ride duration (e.g., extremely long or short rides).\n","- Inconsistent formatting (e.g., timestamps in different formats)."]},{"cell_type":"markdown","id":"cfe904fe","metadata":{"papermill":{"duration":0.008998,"end_time":"2025-02-02T17:36:40.443837","exception":false,"start_time":"2025-02-02T17:36:40.434839","status":"completed"},"tags":[]},"source":["---\n","Process\n","---\n","\n","**Key tasks**:\n","- Check the data for errors.\n","- Choose our tools.\n","- Transform the data so our team can work with it effctively.\n","- Document the cleaning process.\n","\n","Our team choose R as the main tool for data cleaning and data analysis since R is a powerf